    ?member1 <http://dbpedia.org/ontology/member> <http://dbpedia.org/resource/Fredrik_Thordendal> . 
    ?member1 a <http://dbpedia.org/ontology/Organization> . 
    ?member1 a <http://dbpedia.org/ontology/Band> . 
    ?member1 a <http://dbpedia.org/ontology/Group> . 
    ?result <http://dbpedia.org/ontology/associatedMusicalArtist> ?member1 . 
  } UNION { 
    ?member2 <http://dbpedia.org/ontology/member> <http://dbpedia.org/resource/S.A._Slayer> . 
    ?result <http://dbpedia.org/ontology/associatedMusicalArtist> ?member2 . 
  } UNION { 
    ?member3 <http://dbpedia.org/ontology/member> <http://dbpedia.org/resource/Don_Dokken> . 
    ?result <http://dbpedia.org/ontology/associatedMusicalArtist> ?member3 . 
  }
}

SELECT ?admin ?deathPlace WHERE { 
    <http://dbpedia.org/resource/Forza_Italia_(2013)> <http://dbpedia.org/ontology/administration> ?admin . 
    ?author <http://dbpedia.org/property/title> "The Twelve Abbots of Challant" . 
    ?author <http://dbpedia.org/ontology/deathPlace> ?deathPlace . 
}

SELECT ?country WHERE { 
  ?leader <http://dbpedia.org/property/election> <http://dbpedia.org/resource/1962_New_South_Wales_state_election> . 
  ?leader <http://dbpedia.org/ontology/birthPlace> ?birthPlace . 
  ?birthPlace a <http://dbpedia.org/ontology/Country> . 
  { <http://dbpedia.org/resource/Beauchamp_Seymour,_1st_Baron_Alcester> <http://dbpedia.org/ontology/war> ?war1 . }
  UNION 
  { <http://dbpedia.org/resource/New_Zealand_Army> <http://dbpedia.org/ontology/war> ?war2 . }
  BIND(?birthPlace AS ?country)
}

SELECT ?commanderMola ?commanderFranco WHERE { 
    <http://dbpedia.org/resource/Emilio_Mola> <http://dbpedia.org/ontology/commanded> ?forceMola . 
    ?forceMola a <http://dbpedia.org/ontology/Event> . 
    <http://dbpedia.org/resource/Francisco_Franco> <http://dbpedia.org/ontology/commanded> ?forceFranco . 
    ?forceFranco a <http://dbpedia.org/ontology/SocietalEvent> ; 
                  a <http://dbpedia.org/ontology/Event> ; 
                  a <http://dbpedia.org/ontology/MilitaryConflict> . 
    ?forceMola <http://dbpedia.org/ontology/commander> ?commanderMola . 
    ?forceFranco <http://dbpedia.org/ontology/commander> ?commanderFranco . 
}

SELECT ?associatedArtist WHERE { 
  { 
    <http://dbpedia.org/resource/Watchtower_(band)> <http://dbpedia.org/ontology/associatedMusicalArtist> ?artist . 
    ?artist <http://dbpedia.org/ontology/associatedMusicalArtist> ?associatedArtist .
  } UNION {
    ?member <http://dbpedia.org/ontology/associatedMusicalArtist> <http://dbpedia.org/resource/Meshuggah> .
    ?member <http://dbpedia.org/ontology/associatedMusicalArtist> ?associatedArtist .
  }
  ?associatedArtist a <http://dbpedia.org/ontology/Band> .
  ?associatedArtist a <http://dbpedia.org/ontology/Group> .
  ?associatedArtist a <http://dbpedia.org/ontology/Organisation> .
}

SELECT ?territory WHERE { 
  ?figure a <http://dbpedia.org/ontology/Settlement> ; 
          a <http://dbpedia.org/ontology/Town> ; 
          a <http://dbpedia.org/ontology/Icelandic> ; 
          rdfs:label "Land of fire and ice"@en ; 
          <http://dbpedia.org/property/region> <http://dbpedia.org/resource/Greenwich_Mean_Time> ; 
          <http://dbpedia.org/property/work> "Article 62, Section IV of Constitution of Iceland" . 
  ?territory <http://dbpedia.org/ontology/administrativeRegion> ?figure .
}

SELECT ?actor WHERE { 
    ?actor <http://dbpedia.org/ontology/child> <http://dbpedia.org/resource/Jon_Pertwee> . 
    ?actor <http://dbpedia.org/ontology/birthPlace> <http://dbpedia.org/resource/London> . 
    ?actor <http://dbpedia.org/ontology/claimToFame> ?claim . 
    { ?claim a <http://dbpedia.org/ontology/Film> . }
    UNION
    { ?claim a <http://dbpedia.org/ontology/MilitaryConflict> . }
    FILTER(?actor = <http://dbpedia.org/resource/Sean_Pertwee>)
}

SELECT ?settlement ?region WHERE { 
  <http://dbpedia.org/resource/Democratic_Party_(Italy)> <http://dbpedia.org/ontology/associatedPlace> ?settlement . 
  ?settlement a <http://dbpedia.org/ontology/Settlement> ; 
              a <http://dbpedia.org/ontology/Region> ; 
              a <http://dbpedia.org/ontology/Italian> ; 
              a <http://dbpedia.org/ontology/State> . 
}
